import React from 'react'

export const CircleImage = ({url, title, action}) =>{
    return(
        <a style={{display: "block", textAlign: "center", marginLeft: '12px'}}>
            <img height={56} width={56} style={{'border-radius': "50%"}}  src={url} alt={title}/>
            <h5 style={{padding:'4px', width: "140px"}}> {title} </h5>
        </a>
    )
}
